(function (root, factory) {
  console.log(`这是引入的包入口`)
  if(typeof define === "function" && define.amd) {
    // AMD
    define([], function () {
      return factory();
  });
  } else if (typeof module === "object" && module.exports) {
    // CommonJs
    module.exports = factory();
  } else {
    // Browser globals
    root.workSpace = factory();
}

}(typeof window !== "undefined" ? window : this, function () { 
    'use strict';
    /**
     * region 系统空间
     * module 头部菜单可以
     * is_menu_mfe 是否是微前端
     * product_key 产品key
     * uniq_key 菜单key
     * return 
     *  /region/module/product_key/is_menu_mfe/uniq_key
    */
    const getWorkSpaceUrl = function(region = '', module = '', product_key = '', uniq_key = '', is_menu_mfe = false, host = '') {
      console.log('这里是你执行了test方法')
      // 跳转url拼接
      let res = `/${region}/${module}/${product_key}/${is_menu_mfe ? 'mfe' : 'iframe'}/${uniq_key}`
      // 域名添加
      if(!host){
        res = `//wdata.didi.cn${res}`
      } else {
        res = `${host}${res}`
      }
      return res
    }
    return {
      getWorkSpaceUrl
    }
}))
